Hippo: Natures Wild Feast

Nature Documentary hosted by Mark Evans, published by Channel 4 in 2011 - English narration


Information
------------------------------

A new high-tech natural history event, Hippo: Nature's Wild Feast presents the most comprehensive illustration to date of nature's food chain in action. The programme, anchored live from Zambia's Luangwa Valley, will show the events of the past fortnight as an entire ecological system including predators, scavengers, birds and insects consumed the enormous carcass of an adult hippo. Located by a section of the Luangwa river, a prime location for some of the biggest predators in Zambia, the hippo will have been in the sights of the notoriously vicious honey badger, leopards, lions, Nile crocodiles, hyenas, wild dogs, baboons, monitor lizards and marabou storks: known as the 'undertaker birds' and which use their 10-foot wingspan to swoop down and see off other smaller vultures.

